measurements.description:
One flower on one inflorescence; dorsal sepal green with burgundy distinct spots, large white margin;
    synsepal green with random burgundy spots; petals base color green, upper half tan-brown, 
    lower half lighter tan-brown with faint venation, red-brown proximally;
    pouch base color green overlaid red-brown, midline stripe, red-brown interior with burgundy stripe;
    staminode butter-yellow overlaid faint red; substance medium; texture glossy.
